import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card.js';
import 'tachyons';
import * as serviceWorker from './serviceWorker';
import {robots} from './robots.js';

ReactDOM.render(<div>
	<Card id ={robots[0][0].id} name={robots[0].name} email={robots[0].email}/>
	<Card id ={robots[0][1].id} name={robots[1].name} email={robots[1].email}/>
	<Card id ={robots[2].id} name={robots[2].name} email={robots[2].email}/></div>,document.getElementById('root'))






// If you want your app to work offline and load faster, you can change
